const apikey = "a01ab72148f349e29e1952bdb332282d";
const blogContainer = document.getElementById("blog-container");
const searchField = document.getElementById('search-input');
const searchButton = document.getElementById('search-button');
const toggleButton = document.getElementById('toggle-button');

let currentCountry = 'us'; // Default country is US

async function fetchNews(country) {
    try {
        const timestamp = new Date().getTime(); // Generate a unique timestamp
        const apiUrl = `https://newsapi.org/v2/top-headlines?country=${country}&pageSize=20&apiKey=${apikey}&_=${timestamp}`; // Added timestamp to the URL
        const response = await fetch(apiUrl);
        const data = await response.json();
        return data.articles;
    } catch (error) {
        console.error(`Error Fetching ${country.toUpperCase()} News`, error);
        return [];
    }
}

searchButton.addEventListener("click", async () => {
    const query = searchField.value.trim();
    if (query !== "") {
        try {
            const articles = await fetchNewsQuery(query);
            displayBlogs(articles);
        } catch (error) {
            console.log("Error fetching news by query", error);
        }
    }
});

async function fetchNewsQuery(query) {
    try {
        const timestamp = new Date().getTime(); // Generate a unique timestamp
        const apiUrl = `https://newsapi.org/v2/everything?q=${query}&pageSize=20&apiKey=${apikey}&_=${timestamp}`; // Added timestamp to the URL
        const response = await fetch(apiUrl);
        const data = await response.json();
        return data.articles;
    } catch (error) {
        console.error("Error Fetching News by Query", error);
        return [];
    }
}

function displayBlogs(articles) {
    if (!blogContainer) {
      console.error("Blog container not found");
      return;
    }
    blogContainer.innerHTML = "";
    articles.forEach((article) => {
      const blogCard = document.createElement("div");
      blogCard.classList.add("blog-card");

      if (article.urlToImage) {
        const img = document.createElement("img");
        img.src = article.urlToImage;
        img.alt = article.title;
        img.onerror = () => {
          // Load a default image when the original image is not available
          img.src = "data:image/png;base64,"
          img.alt = "Image not available";
        };
        blogCard.appendChild(img);
      } else {
        // If no image, add a placeholder or a default image
        const img = document.createElement("img");
        img.src = "data:image/png;base64,"
        img.alt = "Image not found";
        blogCard.appendChild(img);
      }

      const title = document.createElement("h2");
      const truncatedTitle = article.title.length > 30 ? article.title.slice(0, 30) + "..." : article.title;
      title.textContent = truncatedTitle;
      blogCard.appendChild(title);

      if (article.description && article.description !== "") {
        const description = document.createElement("p");
        const truncatedDescription = article.description.length > 120 ? article.description.slice(0, 120) + "..." : article.description;
        description.textContent = truncatedDescription;
        blogCard.appendChild(description);
      } else {
        const description = document.createElement("p");
        description.textContent = "No description available. Please click the link above to read the article.";
        blogCard.appendChild(description);
      }

      blogCard.addEventListener("click", () => {
        window.open(article.url, "_blank");
      });

      blogContainer.appendChild(blogCard);
    });
}
async function loadAndDisplayNews() {
    try {
        const articles = await fetchNews(currentCountry);
        displayBlogs(articles);
    } catch (error) {
        console.error("Error Fetching News", error);
    }
}

toggleButton.addEventListener("click", () => {
    currentCountry = currentCountry === 'us' ? 'in' : 'us'; // Toggle between US and India
    loadAndDisplayNews(); // Fetch and display news for the new country
});

// Initial load
loadAndDisplayNews();

// Auto reload every 5 minutes
setInterval(loadAndDisplayNews, 300000); // 300,000 milliseconds = 5 minutes



